import axios from 'axios';
const baseUrl = 'http://localhost:3000/todos/';
export default {
  name: 'App',
  data() {
    return {
      todos: []
    };
  },
  methods: {
    async GetApi() {
      await axios.get(baseUrl).then(resp => {
        this.todos = resp.data;
      }).catch(err => {
        console.log(err);
      });
    }
  }
};
